let state ={
    dialogs : [
        {id: 1, name: 'Vlad'},
        {id: 2, name: 'Oleg'},
        {id: 3, name: 'Sveta'},
        {id: 4, name: 'Katya'},
        {id: 5, name: 'Olya'}
    ],
    messages :  [
        {id: 1, message: 'hi'},
        {id: 2, message: 'yo'},
        {id: 3, message: 'hello'},
        {id: 4, message: 'ky'},
        {id: 5, message: 'privet'}
    ],
    PostData : [
        {id: 1, Post: 'post1', likesCount :12},
        {id: 2, Post: 'post2', likesCount :2},
        {id: 3, Post: 'post3', likesCount :11},
        {id: 4, Post: 'post4', likesCount :5},
        {id: 5, Post: 'post5', likesCount :121}
    ]
}
export default state;
